import numpy as np

# Define functions to generate random samples based on given statistics
def generate_target_thickness(size=1):
    return np.random.normal(loc=1.02, scale=np.sqrt(16.9), size=size)
def generate_pulse_width(size=1):
    return np.clip(np.random.normal(loc=291, scale=500, size=size)  # Adjusted to ensure the minimum and maximum are within given ranges
def generate_energy(size=1):
    return np.clip(np.random.normal(loc=13.9, scale=2350, size=size)
def generate_spot_size(size=1):
    return np.clip(np.random.normal(loc=3.61, scale=13.7, size=size)
def generate_intensity(size=1):
    return np.clip(np.random.lognormal(mean=5.10e20, sigma=np.sqrt(3.96e41), size=size)
def generate_power(size=1):
    return np.clip(np.random.normal(loc=6.23e13, scale=4.03e27, size=size)
def generate_cutoff_energy(size=1):
    return np.clip(np.random.lognormal(mean=8.64, sigma=np.sqrt(156), size=size)

# Example function to ensure the generated values meet minimum and maximum constraints
def ensure_constraints(feature, data):
    while True:
        sample = np.array([f(generate_feature()) for f in [target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy]][0:6])
        if all(np.all(sample >= min_vals) and all(sample <= max_vals):  # Checking against the minimum and maximum values for each feature
            return sample

