max_target_thickness = 1.0
min_pulse_width = 24  # From Q10 and Max, adjusted for the range of pulse widths given in examples
max_pulse_width = 12900
# Adjusting max pulse width based on provided example data to be within realistic bounds (assuming it's a typo or misreported value)
min_spot_size = 2.3  # Example min value; assuming spot size is in micrometers and requires this constraint
max_spot_size = 60
# Assuming intensity, power, cutoff energy minimum/maximum values are calculated similarly based on given examples or additional constraints if available
min_intensity = 1.05e18
max_intensity = 5.59e21
min_power = 1.76e11
max_power = 3.83e14
min_cutoff_energy = 3.3  # From Q10 and Max, assuming a realistic power-to-energy correlation (not directly provided)
max_cutoff_energy = 95

# Generate synthetic data points until we have 25 samples that meet all constraints
data_points = []
for _ in range(25):
    try:
        sample = ensure_constraints([min_target_thickness, np.random.normal(loc=max_pulse_width, scale=np.percentile([0.375 * max_pulse_width for _ in range(6)], size=1)[0] + 
                  [np.percentile(generate_feature(), q) for feature in [target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy][0:6] for q in [0.1, .25, .75, .9]]
        if all(np.all(sample >= min_vals) and all(sample <= max_vals):
            data_points.append(sample)
    except ValueError:  # In case a sample doesn't meet constraints
        continue

# Convert the list of samples into an array format for the final output, assuming that we have defined min/max values as variables above
final_data = np.array(data_points).T  # Transpose to match the order: target_material, target_thickness, pulse_width, etc.

# Since 'target_material' is a categorical feature, let's generate it from an enum of materials like ['aluminium', 'gold', 'plastic', 'polypropylene', 'polystyrene']
import random
materials = ['aluminium', 'gold', 'plastic', 'polypropylene', 'polystyrene']  # Extend this list with more materials if needed
generated_samples = np.column_stack([[random.choice(materials)] + data_points)

# Checking for a complete array of 25 samples including the categorical feature (target_material) and numeric features
assert len(generated_samples) == 25, "Exactly 25 samples were not generated"

print("Generated Data:")
for point in generated_samples:
    print(point)
